@André Paes-MaoAm o intuito do meu comentário foi mostrar o rápido avanço da pandemia, q aliás agr está muito pior. 
Escrevi há dois meses atrás falando q o Brasil tava com mais de 200 sendo q agr estamos à beira dos 1 milhão de infectados. 
Assustador, infelizmente.

